import React, { useState } from 'react';

function SignUp() {
  const [names, setNames] = useState('');
  const [email, setEmail] = useState('');
  const [confirmEmail, setConfirmEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [paymentDetails, setPaymentDetails] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [desiredDate, setDesiredDate] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Basic validation example
    if(email !== confirmEmail) {
      alert("Emails do not match.");
      return;
    }
    if(password !== confirmPassword) {
      alert("Passwords do not match.");
      return;
    }
    // Here, you would handle the sign-up logic, such as sending the data to your backend.
    console.log('Submitted with:', { names, email, password, paymentDetails, phoneNumber, desiredDate });
  };

  return (
    <div>
      <h2>Sign Up</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="names">Names of the Couple:</label>
          <input
            type="text"
            id="names"
            value={names}
            onChange={(e) => setNames(e.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="email">Email:</label>
          <input
            type="email"
            id="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="confirmEmail">Confirm Email:</label>
          <input
            type="email"
            id="confirmEmail"
            value={confirmEmail}
            onChange={(e) => setConfirmEmail(e.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="password">Password:</label>
          <input
            type="password"
            id="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="confirmPassword">Confirm Password:</label>
          <input
            type="password"
            id="confirmPassword"
            value={confirmPassword}
            onChange={(e) => setConfirmPassword(e.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="paymentDetails">Payment Details:</label>
          <input
            type="text"
            id="paymentDetails"
            value={paymentDetails}
            onChange={(e) => setPaymentDetails(e.target.value)}
          />
        </div>
        <div>
          <label htmlFor="phoneNumber">Phone Number:</label>
          <input
            type="tel"
            id="phoneNumber"
            value={phoneNumber}
            onChange={(e) => setPhoneNumber(e.target.value)}
            required
          />
        </div>
        <div>
          <label htmlFor="desiredDate">Desired Date:</label>
          <input
            type="date"
            id="desiredDate"
            value={desiredDate}
            onChange={(e) => setDesiredDate(e.target.value)}
            required
          />
        </div>
        <button type="submit">Sign Up</button>
      </form>
    </div>
  );
}

export default SignUp;
